import React from 'react';
import { useNavigate } from 'react-router-dom';
import { formatVersion } from '../utils/formatNumbers';

// Import Code-XR logos
import CodeXRIconPNG from '../assets/logos/icon.png';

// Import hooks
import { 
  useExtensionStats, 
  useScrollProgress, 
  useSlideNavigation, 
  useRotatingText 
} from '../hooks';

// Import all section components
import { FAB, ProgressBar, SlideNavigation } from '../components';
import {
  HeroSection,
  HeroMultimediaSection,
  FeaturesSection,
  HowToUseSection,
  BenefitsSection,
  TechnologiesSection,
  DownloadSection
} from '../components/sections';

function Home() {
  const navigate = useNavigate();

  // ✨ REFACTORIZADO: Usar hooks personalizados
  const { version } = useExtensionStats();

  const { containerRef, scaleX } = useScrollProgress({
    stiffness: 100,
    damping: 30,
    restDelta: 0.001
  });

  const { currentSlide, totalSlides, goToSlide } = useSlideNavigation(7);

  const { currentText: currentRotatingText, currentIndex: currentTextIndex } = useRotatingText([
    "Visualize your code metrics in Augmented and Virtual Reality.",
    "Transform static code analysis into immersive XR exploration.",
    "Experience your code in XR or on-screen — clear, structured, insightful.",
    "Step beyond the editor — analyze code with spatial context in XR.",
    "From static views to immersive XR — see what your code is really doing.",
    "Code metrics reimagined — interactively, spatially, in XR."
  ], {
    interval: 6000,
    autoStart: true,
    loop: true
  });

  return (
    <div className="App">
      {/* Progress Bar */}
      <ProgressBar progress={scaleX} />

      <div ref={containerRef} className="scroll-container">
        {/* Header */}
        <header className="header">
          <nav className="nav-container">
            <div className="logo-container" onClick={() => goToSlide(0)}>
              <img src={CodeXRIconPNG} alt="Code-XR" className="logo-icon" />
              <span className="logo-text">Code-XR</span>
              <span className="version-badge">{formatVersion(version)}</span>
            </div>

            <div className="nav-menu">
              <button className="nav-link internal" onClick={() => goToSlide(1)}>
                <span className="nav-text">Multimedia</span>
              </button>
              <div className="nav-separator"></div>
              <button className="nav-link internal" onClick={() => goToSlide(2)}>
                <span className="nav-text">Features</span>
              </button>
              <div className="nav-separator"></div>
              <button className="nav-link internal" onClick={() => goToSlide(3)}>
                <span className="nav-text">How to Use</span>
              </button>
              <div className="nav-separator"></div>
              <button className="nav-link internal" onClick={() => goToSlide(5)}>
                <span className="nav-text">Technologies</span>
              </button>
              <div className="nav-separator"></div>
              <a 
                href="https://github.com/aMonteSl/babiaxr-vscode"
                target="_blank"
                rel="noopener noreferrer"
                className="nav-link external"
              >
                <span className="nav-text">GitHub</span>
                <span className="external-icon">↗</span>
              </a>
              <a 
                href="https://marketplace.visualstudio.com/items?itemName=aMonteSl.code-xr"
                target="_blank"
                rel="noopener noreferrer"
                className="nav-link external"
              >
                <span className="nav-text">Marketplace</span>
                <span className="external-icon">↗</span>
              </a>
            </div>
          </nav>
        </header>

        {/* Slide Navigation */}
        <SlideNavigation 
          currentSlide={currentSlide}
          totalSlides={totalSlides}
          onSlideChange={goToSlide}
          showCounter={true}
        />

        {/* Sections */}
        <HeroSection 
          currentTextIndex={currentTextIndex}
          rotatingTexts={[currentRotatingText]} // Pasar solo el texto actual
          goToSlide={goToSlide}
        />

        <HeroMultimediaSection goToSlide={goToSlide} />
        <FeaturesSection goToSlide={goToSlide} />
        <HowToUseSection goToSlide={goToSlide} />
        <BenefitsSection goToSlide={goToSlide} />
        <TechnologiesSection goToSlide={goToSlide} />
        <DownloadSection />

        <FAB />
      </div>
    </div>
  );
}

export default Home;
